import * as React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { Typography } from '@mui/material';

export default function Setting() {
  return (
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'wrap',
        '& > :not(style)': {
          m: 1,
          width: 428,
          height: 428,
        },
      }}
    >
      <Paper elevation={4} >
            <Typography variant = "h5" padding ={2} align ="left">Servier Status</Typography>
            <Typography variant = "h6" padding ={2} align ="left">Server Bravo</Typography>

      </Paper>


    </Box>
  );
}
